.wrapper{

    height:100vh;
    width:100vw;


}
.accordion{
    width:500px;
}
.item{
    background:Black;
    margin-bottom:5px;
    padding:10px 20px;

}
.title{
    color:white;
    display:flex;
    justify-content:space-between;
    align-items:center;
    ccursor:pointer;
}
.content{
    color:white;
    max-height:0;
    overflow:hidden;
    transition: all 0.5s cubic-bezier(0,1,0,1);
}
.content.show{
    color:white;
    height:auto;
    max-height:9999p;
    transition:all 0.5s cubic-bezier(1,0,1,0);
}
`;
function App() {
    // App.js
    const toggle =(i) =>{
        if(selected == i ){
            return setSeleted(null);
        }
        setSeleted(i);
    }
    const [selected,setSeleted]=useState(null);
    const [message, setMessage] = useState("");

    useEffect(() => {
        fetch('/home1')
        .then(response => response.text())
        .then(message => {
        setMessage(message);
        });
        },[])

    return (

        <div>
            <Switch>
