                    <Route path="/Profile_PJ" component={Profile_PJ}>
                    <AC>
                        <div className='wrapper'>
                    <h1>Project_LIST</h1>

      <div className="accordion">

            {data.map((item,i)=> (
                <div className='item'>
                    <div className='title' onClick={()=> toggle(i)}>
                        <h2>{item.question}</h2>
                        <span>{selected == i ? <FaMinus/> : <FaPlus/>} </span>
                    </div>
                    <br></br>
                    <div style={{color:"white"}} className={selected == i ? 'cotent show' : 'content'}>{item.answer}</div>
                </div>
            ))}
      </div>
      <br></br>
      </div>

      </AC>

                    </Route>
            </Switch>

